let ROOT, SOCKET_ROOT;

if (process.env.NODE_ENV === 'development') {
  ROOT = 'http://localhost:8081';
  SOCKET_ROOT = 'http://localhost:8081';
} else {
  ROOT = 'https://jxsbyfmks7.execute-api.ap-northeast-2.amazonaws.com/prod/auth/user';
  SOCKET_ROOT = 'https://qi4n73enh8.execute-api.ap-northeast-2.amazonaws.com/production/@connections';
}

export const config = {
  ROOT: process.env.REACT_APP_ROOT,
  SOCKET_ROOT: process.env.REACT_APP_SOCKET_ROOT
};
